import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import  firebase from 'firebase'
const firebaseConfig = {
  apiKey: "AIzaSyB7fTAq6fTfdOpIk-kAq9qf2wHYNzNfd2w",
  authDomain: "react-app-9a030.firebaseapp.com",
  databaseURL: "https://react-app-9a030.firebaseio.com",
  projectId: "react-app-9a030",
  storageBucket: "react-app-9a030.appspot.com",
  messagingSenderId: "242306070111",
  appId: "1:242306070111:web:3b6d9e7f544b132b100dea",
  measurementId: "G-VVWFKWRP8N"
};
firebase.initializeApp(firebaseConfig)
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
